import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from '../Home/Home'
import Cart from '../Cart/Cart'

const Main = () => {
    return (
        <div>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route exact path="/carrito" component={Cart} />
          </Switch>
        </div>
    );
}

export default Main;
